import React from 'react';
import {Card} from 'react-bootstrap';

const Idea = ({datos}) => {
  return (
  
      <>
     
        <Card
          bg={'primary'}
          key={'primary'}
          text={'white'}
          className="mb-2"
        >
          <Card.Header>{datos.idea}</Card.Header>
          <Card.Body>
            <Card.Text>
            {datos.description}
            </Card.Text>
            <footer className="blockquote-footer">
           Author: <cite title="Source Title">{datos.author.name}</cite>
          </footer>
          </Card.Body>
        </Card>
      
    </>
   
    )
}

export default Idea
